import styled from "styled-components";

export const Title = styled.h3`
  color: #fff;
  font-size: 1.2rem;
  letter-spacing: 2px;
  font-weight: normal;
  text-align: center;
`;

export const SkillContainer = styled.div`
  padding: 100px 0 160px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  background: #4b59f7
  align-items: center;
`;
